import React from "react";

var curtime="";
let time = new Date().toLocaleTimeString();
function curtimefun()
{
  curtime={time};
}

function App() {
  return (
    <div className="container">
      <h1>{curtime}</h1>
      <button onClick={curtimefun}>Get Time</button>
    </div>
  );
}

export default App;
